// react
import React from 'react';

// third-party
import { NavLink } from 'react-router-dom';

function NavLinks() {
    const links = [
        { title: "General search", url: '/search' },
        { title: "Sent/Received documents", url: '/orders' },
        { title: "Setings", url: '/options' }
    ];

    const linksList = links.map((item, index) => (
        <li key={index} className="nav-links__item">
            <NavLink exact activeClassName="selected" to={item.url}>{item.title}
            </NavLink>
        </li>
    ));

    return (
        <ul className="nav-links__list">
            {linksList}
            <li>
                <NavLink exact activeClassName="selected" to={'/pages/search'}>
                    test
                </NavLink>
            </li>
        </ul>

    );
}

export default NavLinks;
